            <Media />
        </Tab>

        <Tab 
            options={{
            duration: 300, onShow: null, responsiveThreshold: Infinity, swipeable: false
            }}
            title="Security">
            <Security />
        </Tab>
    </Tabs>

    <div className="router-equipement">
        <div className="router-item"><Link to= "/Accessories"> Accessories <i className='fas fa-box-open'></i></Link></div>
        <div className="router-item"><Link to= "/Accessories"> Accessories <i className='fas fa-box-open'></i></Link></div>
